INSERT INTO `blast_content` (`id`, `nodeId`, `enable`, `addTime`, `title`, `content`) VALUES
(123, 2, 1, 1504519597, '研究“和值 跨度” 浙江绍兴彩民中排列3万元', '<span style=\"color:#333333;font-family:Tahoma, Geneva, sans-serif;font-size:14px;background-color:#F4F7F4;\">9月15日，体彩“排列3”玩法第16252期开奖号码为“459”，位于绍兴新昌马大王大明路58号3306052030101门店中出“排列3”直选15注，组选1注，奖金共计15773元。&nbsp;</span><br />\n<br />\n<span style=\"color:#333333;font-family:Tahoma, Geneva, sans-serif;font-size:14px;background-color:#F4F7F4;\">据了解，中奖彩民杨先生钟爱体彩“排列3”玩法，每期必买，且颇有研究。每期看好的号码，他都要进行倍投，之前也中过几次“排列3”奖金。杨先生投注该玩法有自己的特别见解，喜欢从和值、跨度方面来研究。当天，杨先生如往常一样来到销售点，对着“排列3” 走势图观察，研究起号码。他感觉本期号码跨5以及和值18点结合起来比较不错，锁定号码“459”，果断倍投了直选15倍，组选也买了1注。果然，当晚就开出这注号码。&nbsp;</span><br />\n<span></span><br />\n<span style=\"color:#333333;font-family:Tahoma, Geneva, sans-serif;font-size:14px;background-color:#F4F7F4;\">第二天一早，杨先生带着家人一起来到销售点领奖，接过奖金后，杨先生笑着说：“=刚好是中秋节小长假，正好可以利用这笔奖金带着家人去周边景点游玩一下。”</span>'),
(124, 2, 1, 1504519627, '11选5”中奖达人 小复式120倍斩获6万多', '<span style=\"color:#333333;font-family:宋体, Arial, Helvetica, sans-serif;font-size:14px;\">12月5日上午11时刚过，体彩中心就迎来一位“11选5”中奖达人，该幸运彩民上午狂中13120510期复式120倍投“11选5”任五，奖金高达6万多元。</span><br />\n<span style=\"color:#333333;font-family:宋体, Arial, Helvetica, sans-serif;font-size:14px;\">经了解得知，这位中奖达人陈先生是位铁杆高频彩民，基本上是每天必买，更难得的是陈先生还把玩彩获得的经验、技巧运用到购买体彩“11选5”的游戏实践中，以提高自己的命中率。</span><br />\n<span style=\"color:#333333;font-family:宋体, Arial, Helvetica, sans-serif;font-size:14px;\">12月5日上午，陈先生来到自己常去销售网点。经过一番研究后，他精选出了1、3、4、5、7、8、10，预感很快就应该开出，用这7个数组合6码复式票，就做了5期的短期投注计划，每期以两张60倍的6码复式任五进行倍投。</span><br />\n<span style=\"color:#333333;font-family:宋体, Arial, Helvetica, sans-serif;font-size:14px;\">当到第13120510期的时候，惊喜随之降临。开奖结果显示，陈先生凭借准确的判断，通过两张60倍的6码复式</span><span style=\"color:#333333;font-family:宋体, Arial, Helvetica, sans-serif;font-size:14px;\">就中了64800元。</span>'),
(125, 2, 1, 1504597511, '研究“和值 跨度” 浙江绍兴彩民中排列3万元', '<div class=\"top_links\" style=\"color:#666666;font-family:\'Microsoft Yahei\';background:#F7A3A3;\">\n	摘要：9月15日，体彩“排列三”玩法第16252期开奖号码为“459”，位于浙江绍兴新昌马大王大明路58号3306052030101门店中出“排列三”直选15注，组选1注，奖金共计15773元……\n</div>\n<div class=\"content\" style=\"margin:35px 8px;font-size:14px;color:#666666;font-family:\'Microsoft Yahei\';background-color:#FFFFFF;\">\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		9月15日，体彩“<a href=\"https://www.cy16cp.com/news/detail.html?key=3422#\">排列三</a>”玩法第16252期开奖号码为“459”，位于浙江绍兴新昌马大王大明路58号3306052030101门店中出“排列三”直选15注，组选1注，奖金共计15773元。\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		据了解，中奖彩民杨先生钟爱体彩“排列3”玩法，每期必买，且颇有研究。每期看好的号码，他都要进行倍投，之前也中过几次“排列3”奖金。杨先生<a href=\"https://www.cy16cp.com/news/detail.html?key=3422#\">投注</a>该玩法有自己的特别见解，喜欢从和值、跨度方面来研究。当天，杨先生如往常一样来到销售点，对着“排列3”&nbsp;<a href=\"https://www.cy16cp.com/news/detail.html?key=3422#\">走势图</a>观察，研究起号码。他感觉本期号码跨5以及和值18点结合起来比较不错，锁定号码“459”，果断倍投了直选15倍，组选也买了1注。果然，当晚就开出这注号码。\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		第二天一早，杨先生带着家人一起来到销售点领奖，接过奖金后，杨先生笑着说：“=刚好是中秋节小长假，正好可以利用这笔奖金带着家人去周边景点游玩一下。”\n	</p>\n</div>'),
(126, 2, 1, 1504597536, '三位得主各用奇招中福彩大奖 却有一个共同点', '<div class=\"top_links\" style=\"color:#666666;font-family:\'Microsoft Yahei\';background:#F7A3A3;\">\n	摘要：福彩3D游戏，被誉为“蓝色的小精灵”，它以独特的魅力，赢得了诸多彩友的青睐。也许这段时间群英会频频为临沂彩友送来了大礼，可爱的小精灵坐不住了，也为彩友们送来了惊喜\n</div>\n<div class=\"content\" style=\"margin:35px 8px;font-size:14px;color:#666666;font-family:\'Microsoft Yahei\';background-color:#FFFFFF;\">\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;福彩3D游戏，被誉为“蓝色的小精灵”，它以独特的魅力，赢得了诸多彩友的青睐。也许这段时间群英会频频为临沂彩友送来了大礼，可爱的小精灵坐不住了，也为彩友们送来了惊喜。\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;7月10日，3D游戏爆发出惊人能量，沂南彩友赵先生（化姓）于37132115福彩站倍投号码“380”一举拿下2016185期奖金107466元；\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;8月2日，兰山彩友田先生（化姓）采用单选位选的方式于37130302、37130290、37130206和37130270四个福彩站收获了奖金46800元；\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;8月5日，河东区彩友李先生（化姓）于37131225福彩站倍投“634”组三和组六喜得奖金36390元。近日，他们纷纷来到市中心兑奖处领取了奖金。\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;兑奖时，我们发现三位中奖彩友都有一个共同的特点：喜欢倍投。在三位中奖彩友中，“彩龄”最少的也有四五年了，他们都很喜欢3D游戏。即使在不同的地方，他们也会利用空闲的时间查看号码走势图，只要瞅准号码，投注起来毫不犹豫。在选号方面，赵先生坦言“和值”很重要；田先生和李先生则侧重于自身的感觉。其实，不管是运用什么方式，能从投注中收获快乐，享受到其中的乐趣就是最大的收获。\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;赵先生说，他每次投注前都会仔细研究一番，有时候定好的号码到了投注站后，还是会根据彩友们或者业主的建议作出相应的调整，群策群力才能收到更好的效果，擒得大奖的几率也会大大提高。\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;相对于赵先生的严格要求，田先生和李先生的选号方式就显得越发的感性。领奖时，他们说，选号其实蛮费脑筋的，有时候上了一天的班或忙了一天后，到投注站买几张彩票，多少有些调整心情的味道，看着哪个号不错就直接选哪个，要是拿不准的还会采取其他的投注方式，比如说位选、复式或组选，也能做到全面的“照顾”。\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;其实，说到底，不管投注福利彩票哪款游戏，选择哪种投注方式，最重要的是保持一个良好的心态，这样才能天天都有一份好心情，在奉献中体验快乐，在投注中享受过程，在过程中收获大奖，一举多得的事情，您说呢？\n	</p>\n</div>'),
(105, 2, 1, 1483804800, ' 铁杆粉丝“豹子控” 倍投赢六千双11购物金', '<p style=\"font-family:微软雅黑;font-size:16px;\">\n	在安徽亳州市利辛县中福在线销售厅内，不仅是中福在线彩民的休闲好去处，厅里的电脑票销售处也非常热闹，每天有很多新老彩民守着“快3”的开奖大屏幕，一起讨论研究开奖号码走势。这其中有不少“快3”的铁杆粉丝——“豹子控”。\n</p>\n<p style=\"font-family:微软雅黑;font-size:16px;\">\n	彩民王先生（化姓）是位不折不扣“快3”迷，对于“快3”他尤喜投注豹子号。这不，11月4号晚上路过销售厅，王先生和销售员闲聊几句后，赶在当天的78期，选择了“111”三个数字，进行25倍投注。随后王先生守在开奖屏幕前，若有所思的等待开奖结果。过了几分钟，当“111”三个数字出现在大屏幕的时候，王先生将6000元奖金收入囊中，他面露喜色说，这个奖金来的正是时候，可以作为双十一购物节的“启动资金”。在场众多彩民纷纷大笑。“快3”开奖速度快，玩法多样新鲜，同时也具有一定的趣味性，这些特点加在一起可谓是吸粉无数。庞大的“快3”后援团在各个福彩投注站随处可见。让我们同彩民朋友共一起期待和见证更多幸运吧。\n</p>'),
(106, 2, 1, 1483804800, '无锡快3彩民有万全之策 喜中豹子奖2万7', '<p style=\"font-size:14px;font-family:宋体;color:#4D4D4D;background-color:#F9F9F9;text-indent:2em;\">\n	彩民周先生家住芦庄，是芦庄五区大桥路32025221站点的快3豹子大户，他每次必买豹子号，投注金额都在百元以上。11月16日，他投注了第1116036期快3豹子号“333”116倍，一举揽获2万7的奖金。\n</p>\n<p style=\"font-size:14px;font-family:宋体;color:#4D4D4D;background-color:#F9F9F9;text-indent:2em;\">\n	别看周先生每次购彩都是大手笔，以为他个性豪放，不拘小节的人那你就错了。周先生投注之前都要思量好久，出手之前必定想好万全之策才放心。“做事不做无用功，宁愿广撒网也不愿意放走一个”是他买票一贯的原则。周先生平时工作繁忙，并没有太多时间研究走势，自然也算不上技术型彩民。但是他做事比较谨慎，计划投注，适当止损，总体来说还是赚了不少奖金。1116036期快3他就以116倍3 3 3中得奖金2万7。\n</p>\n<p style=\"font-size:14px;font-family:宋体;color:#4D4D4D;background-color:#F9F9F9;text-indent:2em;\">\n	当天16号，一直到下午2点都没有出过一个豹子，周先生觉得这个是逮豹子的绝佳机会，他当然不会放过，但是买哪支豹子让他犯了难，思来想去迟迟不敢下手，“让我舍弃任何一个号码我都舍不得，生怕开出我没买的号。”最后，周先生没有放过任何一个机会，买下了全部豹子66倍，因为他觉得66数字比较吉利。虽然1116035期没有开出豹子，但是周先生并不甘心，而且他坚信豹子号这几期肯定要开，于是决定再守一期，一番考虑后他还是用万全之策买下所有豹子并加注50倍共116倍。果然，当天的第一个豹子3 3 3开出，2万7奖金收入了周先生囊中。\n</p>'),
(116, 1, 0, 1499443200, '充值提款', '<div class=\\\"help-wrap-tit\\\" id=\\\"help-38\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	1、使用网上银行安全吗？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	用户在本站充值时选择任一银行卡支付通道后立即进入银行网关，银行卡资料全部在银行网关加密页面上填写，资料提交过程全部采用国际通用的SSL或SET及数字证书进行加密传输，安全性由银行全面提供支持和保护，各银行网上支付系统对网上支付的安全提供保障。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-39\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	2、通过网上充值，出现该页无法显示时怎么办？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	· 没有升级IE浏览器，导致加密级别过低，无法进入银行系统。 请升级到8.0及以上版本。<br />\n· 上网环境或上网方式受限，可能是网络服务商限制，如有条件更换一种上网方式或环境。<br />\n· 瞬间网络不通，尝试刷新页面；如果刷新不能解决问题，可能由于浏览器设置缓存，请在IE菜单—工具—Internet选项—点击\\\"删除cookies\\\"和\\\"删除文件\\\"，用以清除临时文件。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-40\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	3、没有接到银联打过来的电话怎么办？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	在线支付是即时向银行系统提交支付信息的，所以如果出现银行卡卡内金额不足、意外断线等状况而导致支付的不成功，请重新提交一次充值并按在线支付的方法操作。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-41\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	4、提款金额有没有限制？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	本站单笔提款最低金额为100元，无最高限制。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-42\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	5、提款次数有没有限制？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	本公司不限制提款次数。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-43\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	6、提款需要手续费吗？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	· 达到提款条件才能取款。<br />\n· 提款不限次数，手续费根据本站设定。<br />\n· 提款时所产生的银行手续费将全部由本站为您承担。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-44\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	7、提款不成功怎么办？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	提款不成功分两种情况：<br />\n· 提款申请未成功：<br />\n1、提款金额大于账户实有金额。<br />\n2、提款时填写的提款密码与用账户信息设置的提款密码不一致。<br />\n3、银行卡信息不符合规定格式。<br />\n· 申请提款成功，但款项没有到达指定账户：<br />\n1、银行卡卡号填写错误，与用户姓名不符，银行退单。<br />\n一旦发生上述现象，请及时联系客服，由客服人员为您服务。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-45\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	8、如何查询提款记录？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	· 用户登录后点击首页右侧的\\\"提款\\\"。<br />\n· 在提款页面，点击右上角\\\"查看提款记录\\\"。\n</p>'),
(117, 1, 1, 1499443200, '找回密码须知', '<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-28\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;font-size:14px;margin:15px\\\" 0px=\\\"\\\" 0px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';\\\\\\\"=\\\"\\\">\n	1、登录时为什么看不到验证码或总是提示验证码不正确？\n	</div>\n<p style=\\\"\\\\&quot;font-family:\\\\\\\'Microsoft\\\" yahei\\\\\\\';font-size:14px;\\\\\\\"=\\\"\\\">\n	看不到验证码或者总是提示验证码输入错误，可能的原因有：<br />\n· 网速过慢，请多刷新几次页面。<br />\n· 输入错误，数字有全角和半角之分，请换用半角方式输入。<br />\n· 安全级别设置过高，请将IE的安全级别设为“默认级别”。<br />\n· 网页没有自动更新，请先设置浏览器的“Internet临时文件”为“自动”更新。\n		</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-29\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;font-size:14px;margin:15px\\\" 0px=\\\"\\\" 0px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';\\\\\\\"=\\\"\\\">\n	2、忘记了登录密码怎么办？\n			</div>\n<p style=\\\"\\\\&quot;font-family:\\\\\\\'Microsoft\\\" yahei\\\\\\\';font-size:14px;\\\\\\\"=\\\"\\\">\n	· 请及时提供相应信息给客服。系统将重置一个新密码，并把新密码发送到用户注册时提交的电子邮箱中，为保障账户安全，建议用户登录后立即修改密码。\n				</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-30\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;font-size:14px;margin:15px\\\" 0px=\\\"\\\" 0px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';\\\\\\\"=\\\"\\\">\n	3、如何查询购买彩票的记录？\n					</div>\n<p style=\\\"\\\\&quot;font-family:\\\\\\\'Microsoft\\\" yahei\\\\\\\';font-size:14px;\\\\\\\"=\\\"\\\">\n	在\\\\\\\"用户中心\\\\\\\"左侧选择\\\\\\\"交易记录\\\\\\\"，即可查看购买彩票的记录。\n						</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-31\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;font-size:14px;margin:15px\\\" 0px=\\\"\\\" 0px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';\\\\\\\"=\\\"\\\">\n	4、索回密码却收取不到邮件怎么办？\n							</div>\n<p style=\\\"\\\\&quot;font-family:\\\\\\\'Microsoft\\\" yahei\\\\\\\';font-size:14px;\\\\\\\"=\\\"\\\">\n	可以联系客服人员。操作流程如下：<br />\n· 确定您注册时输入的邮箱地址是您现在使用的邮箱。<br />\n· 耐心等待，有时候网络会延时。<br />\n· 请查看一下您的垃圾邮件中，是否有取回密码的邮件。<br />\n· 邮箱自身的问题，存在收不到邮件的情况。<br />\n· 您的邮箱拒收或网络等原因造成邮件接收失败。\n								</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-32\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;font-size:14px;margin:15px\\\" 0px=\\\"\\\" 0px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';\\\\\\\"=\\\"\\\">\n	5、如何修改登录密码？\n									</div>\n<p style=\\\"\\\\&quot;font-family:\\\\\\\'Microsoft\\\" yahei\\\\\\\';font-size:14px;\\\\\\\"=\\\"\\\">\n	操作流程如下：<br />\n· 登录后进入首页，点击右侧的“用户中心”。<br />\n· 在“用户中心”页面左侧“账号信息”中选择“修改密码”。<br />\n· 用户输入旧密码，并设置新密码。<br />\n· 提交信息，修改密码成功，系统提示成功信息。\n										</p>'),
(115, 1, 0, 1483804800, '规则说明', '<div class=\\\"help-wrap-tit\\\" id=\\\"help-46\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	1、我从来没买过彩票，这些彩种都怎么玩？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	点击首页的“玩法”后进入玩法规则页面，选择想要投注的彩种并查看其详细玩法。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-47\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	2、什么是标准投注？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	标准投注包括单式投注和复式投注。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-48\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	3、什么是单式投注？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	单式投注即用户选择一注号码进行投注。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-49\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	4、什么是复式投注？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	复式投注即用户将两注以上号码的组合方式作为一组投注号码同时投注。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-50\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	5、什么是机选投注？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	机选指由系统随机产生投注号码进行投注。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-51\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	6、什么是直选投注？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	直选指将所选号码以唯一的排列方式进行投注。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-52\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	7、什么是组选投注？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	组选指将所选号码的所有排列方式作为一注号码进行投注。如一注3D组选号码的 3个数字有两个数字相同，则有3种不同的排列方式，因而就有3个中奖机会，这种组选投注方式简称组选3。如一注3D组选号码的3个数字各不相同，则有6种 不同的排列方式，因而就有6个中奖机会，这种组选投注方式简称组选6。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-53\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	8、什么是追号投注？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	追号指将一注或一组号码进行两期或两期以上的投注。追号可分为连续追号和间隔追号，连续追号指追号的期数是连续的，间隔追号指追号的期数不连续。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-54\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	9、什么是和值投注？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	和值指投注各号码相加之和，如3D号码123，其和值为6。和值投注即用该和值的所有号码进行投注，如用户选择3D直选和值1，共3注：001、010和100。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-55\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	10、什么是包号投注？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	包号投注指将用户所选择号码的所有组合形式进行投注。如3D组三包号01，共2注：001和110。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-55-2\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	11、什么是胆拖投注？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	胆拖投注也叫基数组合投注，通常由胆码和拖码组成。胆码是用户认为出现机会非常大的号码，在所投注的每一注彩票里都固定出现；拖码即彩民补充的其他不同的号码。拖码与胆码共同组成一注完整的投注号码。\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-56\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	12、为什么号码导入不成功？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	号码导入，有两点要求：号码导入时，必须是文本格式（.txt）<br />\n文本内容有格式要求(双色球、3D)：<br />\na、 确认要导入的号码文件位置,如果没有请新建(英文状态下书写)；<br />\nb、 文本格式按照相关彩种单式手动输入号码的规则；\n</p>\n<div class=\\\"help-wrap-tit\\\" id=\\\"help-57\\\" style=\\\"color:#C71F33;font-size:14px;margin:15px 0px 0px;font-family:\\\'Microsoft Yahei\\\';\\\">\n	13、如何查询追号记录？\n</div>\n<p style=\\\"font-family:\\\'Microsoft Yahei\\\';font-size:14px;\\\">\n	· 用户登录本站，进入会员中心，点击左侧“交易记录”。 · 选择下拉“全部投注”。 · 选择“追号记录”查看，即可查看追号记录。\n</p>'),
(118, 1, 1, 1499443200, '注册时用户注意事项', '<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-22\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;font-size:14px;margin:15px\\\" 0px=\\\"\\\" 0px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';\\\\\\\"=\\\"\\\">\n	1、注册时用户需要注意什么？\n	</div>\n<p style=\\\"\\\\&quot;font-family:\\\\\\\'Microsoft\\\" yahei\\\\\\\';font-size:14px;\\\\\\\"=\\\"\\\">\n	· 用户名一旦提交，不可更改，请选择容易记忆且安全级别高的用户名，并妥善保管。<br />\n· 彩票中心规定按实名制销售彩票。为确保用户中奖权益，请务必注册后，在“用户中心”的“充值”页面绑定银行卡、真实姓名和提款密码。\n		</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-23\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;font-size:14px;margin:15px\\\" 0px=\\\"\\\" 0px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';\\\\\\\"=\\\"\\\">\n	2、注册后为什么要绑定银行卡？\n			</div>\n<p style=\\\"\\\\&quot;font-family:\\\\\\\'Microsoft\\\" yahei\\\\\\\';font-size:14px;\\\\\\\"=\\\"\\\">\n	为了不影响您的充值、投注和提款，注册后须在用户中心绑定银行卡，提交用户真实姓名，设置提款密码。\n				</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-24\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;font-size:14px;margin:15px\\\" 0px=\\\"\\\" 0px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';\\\\\\\"=\\\"\\\">\n	3、注册时把电话号码填写错误有什么影响？\n					</div>\n<p style=\\\"\\\\&quot;font-family:\\\\\\\'Microsoft\\\" yahei\\\\\\\';font-size:14px;\\\\\\\"=\\\"\\\">\n	注册时须提交用户本人真实电话号码，否则会得不到一些公告或活动通知。如用户注册时没有填写电话号码，请尽快联系客服人员进行修改。\n						</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-25\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;font-size:14px;margin:15px\\\" 0px=\\\"\\\" 0px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';\\\\\\\"=\\\"\\\">\n	4、注册时填写的电话号码换了怎么办？\n							</div>\n<p style=\\\"\\\\&quot;font-family:\\\\\\\'Microsoft\\\" yahei\\\\\\\';font-size:14px;\\\\\\\"=\\\"\\\">\n	请尽快联系客服人员进行修改。\n								</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-26\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;font-size:14px;margin:15px\\\" 0px=\\\"\\\" 0px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';\\\\\\\"=\\\"\\\">\n	5、真实姓名填写错误如何修改？\n									</div>\n<p style=\\\"\\\\&quot;font-family:\\\\\\\'Microsoft\\\" yahei\\\\\\\';font-size:14px;\\\\\\\"=\\\"\\\">\n	一经绑定，用户本人无法直接修改真实姓名，但可以联系客服人员进行修改。操作流程如下：<br />\n· 联系客服人员（可通过电话、QQ、邮件等途径），说明修改的原因；<br />\n· 客服部收到授权后，由专员核实信息提交报告，交领导批准签字；<br />\n· 主管领导签字后，技术专员在有人监督的情况下，修改用户的错误信息。\n										</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-27\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;font-size:14px;margin:15px\\\" 0px=\\\"\\\" 0px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';\\\\\\\"=\\\"\\\">\n	6、验证码有何作用？\n											</div>\n<p style=\\\"\\\\&quot;font-family:\\\\\\\'Microsoft\\\" yahei\\\\\\\';font-size:14px;\\\\\\\"=\\\"\\\">\n	设置验证码是为了提高系统的安全性，它可以有效防止针对某个特定账号的暴力破解（即用特定程序进行不断的登录尝试），使用验证码也是目前各网站通行的安全措施。\n												</p>'),
(120, 1, 1, 1499443200, '提款注意事项', '<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-12\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;font-size:14px;margin:15px\\\" 0px=\\\"\\\" 0px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';\\\\\\\"=\\\"\\\">\n	1、如何提款？\n	</div>\n<p style=\\\"\\\\&quot;font-family:\\\\\\\'Microsoft\\\" yahei\\\\\\\';font-size:14px;\\\\\\\"=\\\"\\\">\n	· 用户登录后点击首页右侧的\\\\\\\"提款\\\\\\\"进入提款页面，在提款页面输入提款金额及提款密码并确认。<br />\n· 您的提款申请成功并经核对无误后，将通过银行转账方式提款，3到5分钟实时到账。支持全国所有大小银行。<br />\n· 为了保障您的资金安全，公司提供7X24小时一对一服务。\n		</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-13\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;font-size:14px;margin:15px\\\" 0px=\\\"\\\" 0px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';\\\\\\\"=\\\"\\\">\n	2、提款需要手续费吗？\n			</div>\n<p style=\\\"\\\\&quot;font-family:\\\\\\\'Microsoft\\\" yahei\\\\\\\';font-size:14px;\\\\\\\"=\\\"\\\">\n	· 达到提款条件才能取款。<br />\n· 提款不限次数，手续费根据网站设定。<br />\n· 提款时所产生的银行手续费将全部由本网站为您承担。\n				</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-14\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;font-size:14px;margin:15px\\\" 0px=\\\"\\\" 0px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';\\\\\\\"=\\\"\\\">\n	3、提款次数有没有限制？\n					</div>\n<p style=\\\"\\\\&quot;font-family:\\\\\\\'Microsoft\\\" yahei\\\\\\\';font-size:14px;\\\\\\\"=\\\"\\\">\n	本公司不限制提款次数。\n						</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-15\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;font-size:14px;margin:15px\\\" 0px=\\\"\\\" 0px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';\\\\\\\"=\\\"\\\">\n	4、提款时需要注意哪些事项？\n							</div>\n<p style=\\\"\\\\&quot;font-family:\\\\\\\'Microsoft\\\" yahei\\\\\\\';font-size:14px;\\\\\\\"=\\\"\\\">\n	· 确认提款时提交的的银行信息的正确性。<br />\n· 为了防止少数用户利用信用卡套现和洗钱的行为，保护正常用户的资金安全，本站针对提款做出如下规定：<br />\n1、用户需要达到一定的打码量，才能正常办理提款。<br />\n2、发现异常的提款，要经过审核。\n								</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-16\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;font-size:14px;margin:15px\\\" 0px=\\\"\\\" 0px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';\\\\\\\"=\\\"\\\">\n	5、提款不成功怎么办？\n									</div>\n<p style=\\\"\\\\&quot;font-family:\\\\\\\'Microsoft\\\" yahei\\\\\\\';font-size:14px;\\\\\\\"=\\\"\\\">\n	提款不成功分两种情况：<br />\n· 提款申请未成功：<br />\n1、提款金额大于账户实有金额。<br />\n2、提款时填写的提款密码与用账户信息设置的密码不一致。<br />\n3、银行卡信息不符合规定格式。<br />\n· 申请提款成功，但款项没有到达指定账户：<br />\n1、银行卡卡号填写错误，与用户姓名不符，银行退单。<br />\n一旦发生上述现象，请及时联系客服，由客服人员为您服务。\n										</p>'),
(121, 1, 1, 1499443200, '本站会员必读', '<div class=\\\"\\\\&quot;help-wrap\\\\&quot;\\\" style=\\\"\\\\&quot;font-size:14px;margin:10px\\\" 0px;padding:10px=\\\"\\\" 30px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';background:#ffffff;\\\\\\\"=\\\"\\\">\n<h3 id=\\\"\\\\&quot;help-tit1\\\\&quot;\\\" style=\\\"font-size:18px;color:#FC9721;\\\">\n	常见问题\n</h3>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-1\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		1、如何注册成为会员？\n	</div>\n	<p>\n		· 用户进入彩票网站首页，在首页右侧点击\\\\\\\"注册\\\\\\\"，进入用户注册页面。<br />\n· 在注册页面阅读并同意《彩票网络服务协议》。<br />\n· 在注册页面填写相关信息并提交。<br />\n· 系统返回成功信息，恭喜注册成功。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-2\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		2、在彩票网站注册要收费吗？\n</div>\n<p>\n	· 注册新用户是免费的，不收取任何费用。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-3\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		3、忘记了登录密码怎么办？\n	</div>\n	<p>\n		· 请及时提供相应信息给客服。系统将重置一个新密码，并把新密码发送到用户注册时提交的电子邮箱中，为保障账户安全，建议用户登录后立即修改密码。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-4\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		4、有银行卡就可以充值了吗？\n</div>\n<p>\n	用户拥有了银行卡后，即有多种充值方式可以充值：<br />\n· 已开通网上银行，使用第三方支付平台进行充值，方便、快捷。<br />\n· 未开通网银，可以使用银行转账、微信或支付宝等方式进行充值。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-5\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		5、如何开通网上支付？\n	</div>\n	<p>\n		开通银行卡网上支付功能，包括网上开通和现场开通两种方式：<br />\n· 网上开通：登录各大银行的官方网站在线开通。<br />\n· 现场开通：前往各大银行的营业网点现场开通。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-6\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		6、如何进行充值？\n</div>\n<p>\n	有多种充值方式供您选择，包括：银行转账、第三方支付、微信与支付宝等。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-7\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		7、充值要手续费吗？\n	</div>\n	<p>\n		充值安全、方便、快捷，不收取任何手续费。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-8\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		8、如何查看是否中奖？\n</div>\n<p>\n	登录后，点击首页右侧的\\\\\\\"会员中心\\\\\\\"，点击交易记录，然后勾选\\\\\\\"奖金派送\\\\\\\"，即可查看中奖记录。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-9\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		9、如何查询购买彩票的记录？\n	</div>\n	<p>\n		在\\\\\\\"用户中心\\\\\\\"左侧选择\\\\\\\"交易记录\\\\\\\"，即可查看购买彩票的记录。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-10\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		10、中奖后如何返奖？\n</div>\n<p>\n	本彩票\\\\\\\"自动兑奖，自动返奖\\\\\\\"，所有奖金均由网站系统自动开兑，并自动返还到用户的会员账户中。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-11\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		11、如何查询中奖详情？\n	</div>\n	<p>\n		1、用户登录后点击首页顶部的\\\\\\\"用户中心\\\\\\\"。<br />\n2、在\\\\\\\"用户中心\\\\\\\"左侧选择\\\\\\\"交易记录\\\\\\\"，再选择“交易明细”，即可查看中奖详情。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-12\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		12、如何提款？\n</div>\n<p>\n	· 用户登录后点击首页右侧的\\\\\\\"提款\\\\\\\"进入提款页面，在提款页面输入提款金额及提款密码并确认。<br />\n· 您的提款申请成功并经核对无误后，将通过银行转账方式提款，3到5分钟实时到账。支持全国所有大小银行。<br />\n· 为了保障您的资金安全，公司提供7X24小时一对一服务。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-13\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		13、提款需要手续费吗？\n	</div>\n	<p>\n		· 达到提款条件才能取款。<br />\n· 提款不限次数，手续费根据网站设定。<br />\n· 提款时所产生的银行手续费将全部由本网站为您承担。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-14\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		14、提款次数有没有限制？\n</div>\n<p>\n	本公司不限制提款次数。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-15\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		15、提款时需要注意哪些事项？\n	</div>\n	<p>\n		· 确认提款时提交的的银行信息的正确性。<br />\n· 为了防止少数用户利用信用卡套现和洗钱的行为，保护正常用户的资金安全，本站针对提款做出如下规定：<br />\n1、用户需要达到一定的打码量，才能正常办理提款。<br />\n2、发现异常的提款，要经过审核。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-16\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		16、提款不成功怎么办？\n</div>\n<p>\n	提款不成功分两种情况：<br />\n· 提款申请未成功：<br />\n1、提款金额大于账户实有金额。<br />\n2、提款时填写的提款密码与用账户信息设置的密码不一致。<br />\n3、银行卡信息不符合规定格式。<br />\n· 申请提款成功，但款项没有到达指定账户：<br />\n1、银行卡卡号填写错误，与用户姓名不符，银行退单。<br />\n一旦发生上述现象，请及时联系客服，由客服人员为您服务。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-17\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		17、网上投注的优势有哪些？\n	</div>\n	<p>\n		· 安全便捷：安全、方便、快捷，足不出户，轻松购彩。<br />\n· 永无弃奖：大奖人工通知并自动返还，小奖自动返还。<br />\n· 随时随地：无地域限制，除开奖时间外24小时投注。<br />\n· 信息服务：提供全方位、多样化的彩票信息服务。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-18\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		18、网上投注如何保证彩民利益？\n</div>\n<p>\n	· 自动返奖：\\\\\\\"自动兑奖，自动返奖\\\\\\\"，所有奖金均由网站系统自动开兑并自动返还到用户的账户中。<br />\n· 公开查询：用户可以查询自己的投注记录、中奖记录以及资金明细记录，一切做到有据可查，数据公开。<br />\n· 数据安全：投注数据及相关资料时时备份，网络系统独立设置、隔离并安装有大型硬、软防火墙，安全级别高，确保数据绝对安全。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-19\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		19、对于用户使用本站投注服务的约定\n	</div>\n	<p>\n		· 用户根据自愿的原则，使用本站投注业务，并自己对自己提供的注册信息的真实性负责；<br />\n· 国家明令禁止一切洗钱行为，本站积极响应国家政策，严格控制。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-20\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		20、在本站购彩安全吗？\n</div>\n<p>\n	· 本站是福彩中心与体彩中心授权的合法的网上投注平台，所售彩票都是福彩中心与体彩中心正规发行的彩票。 · 本站彩票已在工信部备案，是真实有效合法的网上投注平台。<br />\n· 本站彩票与多家网站达成购彩合作伙伴关系，比如百度、搜狐、搜狗、腾讯微信、支付宝等。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-21\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		21、如何对网站服务进行投诉？\n	</div>\n	<p>\n		· 如有需要及时处理的事务，请点击页面右侧的在线客服。<br />\n· 工作时间：7X24，永不间断\n	</p>\n</div>\n<div class=\\\"\\\\&quot;help-wrap\\\\&quot;\\\" style=\\\"\\\\&quot;font-size:14px;margin:10px\\\" 0px;padding:10px=\\\"\\\" 30px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';background:#ffffff;\\\\\\\"=\\\"\\\">\n<h3 id=\\\"\\\\&quot;help-tit2\\\\&quot;\\\" style=\\\"font-size:18px;color:#FC9721;\\\">\n	个人账号\n</h3>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-22\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		22、注册时用户需要注意什么？\n	</div>\n	<p>\n		· 用户名一旦提交，不可更改，请选择容易记忆且安全级别高的用户名，并妥善保管。<br />\n· 彩票中心规定按实名制销售彩票。为确保用户中奖权益，请务必注册后，在“用户中心”的“充值”页面绑定银行卡、真实姓名和提款密码。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-23\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		23、注册后为什么要绑定银行卡？\n</div>\n<p>\n	为了不影响您的充值、投注和提款，注册后须在用户中心绑定银行卡，提交用户真实姓名，设置提款密码。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-24\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		24、注册时把电话号码填写错误有什么影响？\n	</div>\n	<p>\n		注册时须提交用户本人真实电话号码，否则会得不到一些公告或活动通知。如用户注册时没有填写电话号码，请尽快联系客服人员进行修改。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-25\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		25、注册时填写的电话号码换了怎么办？\n</div>\n<p>\n	请尽快联系客服人员进行修改。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-26\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		26、真实姓名填写错误如何修改？\n	</div>\n	<p>\n		一经绑定，用户本人无法直接修改真实姓名，但可以联系客服人员进行修改。操作流程如下：<br />\n· 联系客服人员（可通过电话、QQ、邮件等途径），说明修改的原因；<br />\n· 客服部收到授权后，由专员核实信息提交报告，交领导批准签字；<br />\n· 主管领导签字后，技术专员在有人监督的情况下，修改用户的错误信息。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-27\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		27、验证码有何作用？\n</div>\n<p>\n	设置验证码是为了提高系统的安全性，它可以有效防止针对某个特定账号的暴力破解（即用特定程序进行不断的登录尝试），使用验证码也是目前各网站通行的安全措施。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-28\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		28、登录时为什么看不到验证码或总是提示验证码不正确？\n	</div>\n	<p>\n		看不到验证码或者总是提示验证码输入错误，可能的原因有：<br />\n· 网速过慢，请多刷新几次页面。<br />\n· 输入错误，数字有全角和半角之分，请换用半角方式输入。<br />\n· 安全级别设置过高，请将IE的安全级别设为“默认级别”。<br />\n· 网页没有自动更新，请先设置浏览器的“Internet临时文件”为“自动”更新。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-29\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		29、忘记了登录密码怎么办？\n</div>\n<p>\n	· 请及时提供相应信息给客服。系统将重置一个新密码，并把新密码发送到用户注册时提交的电子邮箱中，为保障账户安全，建议用户登录后立即修改密码。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-30\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		30、如何查询购买彩票的记录？\n	</div>\n	<p>\n		在\\\\\\\"用户中心\\\\\\\"左侧选择\\\\\\\"交易记录\\\\\\\"，即可查看购买彩票的记录。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-31\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		31、索回密码却收取不到邮件怎么办？\n</div>\n<p>\n	可以联系客服人员。操作流程如下：<br />\n· 确定您注册时输入的邮箱地址是您现在使用的邮箱。<br />\n· 耐心等待，有时候网络会延时。<br />\n· 请查看一下您的垃圾邮件中，是否有取回密码的邮件。<br />\n· 邮箱自身的问题，存在收不到邮件的情况。<br />\n· 您的邮箱拒收或网络等原因造成邮件接收失败。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-32\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		32、如何修改登录密码？\n	</div>\n	<p>\n		操作流程如下：<br />\n· 登录后进入首页，点击右侧的“用户中心”。<br />\n· 在“用户中心”页面左侧“账号信息”中选择“修改密码”。<br />\n· 用户输入旧密码，并设置新密码。<br />\n· 提交信息，修改密码成功，系统提示成功信息。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-33\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		33、用户为保证账户资金安全应注意哪些事项？\n</div>\n<p>\n	彩民用户必须注意自己电脑中是否有键盘记录或远程控制等木马程序，使用病毒实时监控程序和网络防火墙并注意升级更新操作系统厂商所提供的安全补丁；<br />\n· 尽量不要在公共场所（如网吧）等登录本网站；<br />\n· 尽量在不同场合使用有所区别的密码；<br />\n· 牢记密码，如作记录则应妥善保管；<br />\n· 密码不得告 诉他人，包括自己的亲朋好友；<br />\n· 在登录或网上支付密码输入时，应防止左右可疑的人窥视；<br />\n· 预留密码时不要选用您的身份证、生日、电话、门牌、街巷、重复或连续等易被他人破译的数字。建议选用既不易被他人猜到，又方便记忆的密码；<br />\n· 发现泄密的危险时，及时更换密码；不定期更换密码。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-34\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		34、为什么登录后长时间不登录，要重新登录？\n	</div>\n	<p>\n		用户登录后，长时间不操作电脑，系统就认为用户离开自己的电脑了。为了避免别人趁机使用您的账户投注和保护彩民用户账户的安全，系统有要求用户重新登录的设置。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-35\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		35、为什么用户不能更改注册时提交的用户名？\n</div>\n<p>\n	用户进行投注时，用户名是保障自身利益的唯一凭证。一经注册，不允许更改。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-36\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		36、怎么保护中奖者的个人信息？\n	</div>\n	<p>\n		您的个人信息是保密的，本站不会公布您的信息，请您放心购买。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-37\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		37、如何修改绑定的联系电话？\n</div>\n<p>\n	请尽快联系客服人员进行修改。\n</p>\n	</div>\n<div class=\\\"\\\\&quot;help-wrap\\\\&quot;\\\" style=\\\"\\\\&quot;font-size:14px;margin:10px\\\" 0px;padding:10px=\\\"\\\" 30px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';background:#ffffff;\\\\\\\"=\\\"\\\">\n	<h3 id=\\\"\\\\&quot;help-tit3\\\\&quot;\\\" style=\\\"font-size:18px;color:#FC9721;\\\">\n		充值提款\n	</h3>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-38\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		38、使用网上银行安全吗？\n</div>\n<p>\n	用户在本站充值时选择任一银行卡支付通道后立即进入银行网关，银行卡资料全部在银行网关加密页面上填写，资料提交过程全部采用国际通用的SSL或SET及数字证书进行加密传输，安全性由银行全面提供支持和保护，各银行网上支付系统对网上支付的安全提供保障。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-39\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		39、通过网上充值，出现该页无法显示时怎么办？\n	</div>\n	<p>\n		· 没有升级IE浏览器，导致加密级别过低，无法进入银行系统。 请升级到8.0及以上版本。<br />\n· 上网环境或上网方式受限，可能是网络服务商限制，如有条件更换一种上网方式或环境。<br />\n· 瞬间网络不通，尝试刷新页面；如果刷新不能解决问题，可能由于浏览器设置缓存，请在IE菜单—工具—Internet选项—点击\\\\\\\"删除cookies\\\\\\\"和\\\\\\\"删除文件\\\\\\\"，用以清除临时文件。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-40\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		40、没有接到银联打过来的电话怎么办？\n</div>\n<p>\n	在线支付是即时向银行系统提交支付信息的，所以如果出现银行卡卡内金额不足、意外断线等状况而导致支付的不成功，请重新提交一次充值并按在线支付的方法操作。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-41\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		41、提款金额有没有限制？\n	</div>\n	<p>\n		本站单笔提款最低金额为100元，无最高限制。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-42\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		42、提款次数有没有限制？\n</div>\n<p>\n	本公司不限制提款次数。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-43\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		43、提款需要手续费吗？\n	</div>\n	<p>\n		· 达到提款条件才能取款。<br />\n· 提款不限次数，手续费根据本站设定。<br />\n· 提款时所产生的银行手续费将全部由本站为您承担。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-44\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		44、提款不成功怎么办？\n</div>\n<p>\n	提款不成功分两种情况：<br />\n· 提款申请未成功：<br />\n1、提款金额大于账户实有金额。<br />\n2、提款时填写的提款密码与用账户信息设置的提款密码不一致。<br />\n3、银行卡信息不符合规定格式。<br />\n· 申请提款成功，但款项没有到达指定账户：<br />\n1、银行卡卡号填写错误，与用户姓名不符，银行退单。<br />\n一旦发生上述现象，请及时联系客服，由客服人员为您服务。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-45\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		45、如何查询提款记录？\n	</div>\n	<p>\n		· 用户登录后点击首页右侧的\\\\\\\"提款\\\\\\\"。<br />\n· 在提款页面，点击右上角\\\\\\\"查看提款记录\\\\\\\"。\n	</p>\n</div>\n<div class=\\\"\\\\&quot;help-wrap\\\\&quot;\\\" style=\\\"\\\\&quot;font-size:14px;margin:10px\\\" 0px;padding:10px=\\\"\\\" 30px;font-family:\\\\\\\'microsoft=\\\"\\\" yahei\\\\\\\';background:#ffffff;\\\\\\\"=\\\"\\\">\n<h3 id=\\\"\\\\&quot;help-tit4\\\\&quot;\\\" style=\\\"font-size:18px;color:#FC9721;\\\">\n	规则说明\n</h3>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-46\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		46、我从来没买过彩票，这些彩种都怎么玩？\n	</div>\n	<p>\n		点击首页的“玩法”后进入玩法规则页面，选择想要投注的彩种并查看其详细玩法。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-47\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		47、什么是标准投注？\n</div>\n<p>\n	标准投注包括单式投注和复式投注。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-48\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		48、什么是单式投注？\n	</div>\n	<p>\n		单式投注即用户选择一注号码进行投注。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-49\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		49、什么是复式投注？\n</div>\n<p>\n	复式投注即用户将两注以上号码的组合方式作为一组投注号码同时投注。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-50\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		50、什么是机选投注？\n	</div>\n	<p>\n		机选指由系统随机产生投注号码进行投注。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-51\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		51、什么是直选投注？\n</div>\n<p>\n	直选指将所选号码以唯一的排列方式进行投注。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-52\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		52、什么是组选投注？\n	</div>\n	<p>\n		组选指将所选号码的所有排列方式作为一注号码进行投注。如一注3D组选号码的 3个数字有两个数字相同，则有3种不同的排列方式，因而就有3个中奖机会，这种组选投注方式简称组选3。如一注3D组选号码的3个数字各不相同，则有6种 不同的排列方式，因而就有6个中奖机会，这种组选投注方式简称组选6。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-53\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		53、什么是追号投注？\n</div>\n<p>\n	追号指将一注或一组号码进行两期或两期以上的投注。追号可分为连续追号和间隔追号，连续追号指追号的期数是连续的，间隔追号指追号的期数不连续。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-54\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		54、什么是和值投注？\n	</div>\n	<p>\n		和值指投注各号码相加之和，如3D号码123，其和值为6。和值投注即用该和值的所有号码进行投注，如用户选择3D直选和值1，共3注：001、010和100。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-55\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		55、什么是包号投注？\n</div>\n<p>\n	包号投注指将用户所选择号码的所有组合形式进行投注。如3D组三包号01，共2注：001和110。\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-55-2\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		56、什么是胆拖投注？\n	</div>\n	<p>\n		胆拖投注也叫基数组合投注，通常由胆码和拖码组成。胆码是用户认为出现机会非常大的号码，在所投注的每一注彩票里都固定出现；拖码即彩民补充的其他不同的号码。拖码与胆码共同组成一注完整的投注号码。\n	</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-56\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		57、为什么号码导入不成功？\n</div>\n<p>\n	号码导入，有两点要求：号码导入时，必须是文本格式（.txt）<br />\n文本内容有格式要求(双色球、3D)：<br />\na、 确认要导入的号码文件位置,如果没有请新建(英文状态下书写)；<br />\nb、 文本格式按照相关彩种单式手动输入号码的规则；\n</p>\n<div class=\\\"\\\\&quot;help-wrap-tit\\\\&quot;\\\" id=\\\"\\\\&quot;help-57\\\\&quot;\\\" style=\\\"\\\\&quot;color:#C71F33;margin:15px\\\" 0px=\\\"\\\" 0px;\\\\\\\"=\\\"\\\">\n		58、如何查询追号记录？\n	</div>\n	<p>\n		· 用户登录本站，进入会员中心，点击左侧“交易记录”。 · 选择下拉“全部投注”。 · 选择“追号记录”查看，即可查看追号记录。\n	</p>\n</div>'),
(122, 2, 1, 1483804800, '吉林福彩“快3”大派奖 2600万奖金等您抢', '<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	为回馈广大彩友长期以来对“快3”游戏的喜爱，吉林省福彩中心决定于2016年11月15日起在吉林省范围内开展“快3”游戏2600万派奖活动。派奖期间，如派奖奖金用完，则次日派奖活动停止，欢迎广大彩友积极参与。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	福彩“快3”游戏自上市以来以趣味性足、返奖率高、号码选择少、开奖迅速、中奖容易等特点一直被彩友喜爱，本次派奖活动对“快3”游戏全部二十一种投注方式进行加奖，派奖期间单注奖金平均增加约35%，最高达到40%。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	本次派奖活动是吉林省“快3”游戏历年派奖活动金额最高的一次，喜爱“快3”游戏的彩友要抓住这次机会，在奉献爱心的同时，享受“快3”游戏中奖带来的幸运和快乐。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	<strong>关注“吉林福彩”公众号 订制开奖信息</strong>\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	为回馈新老彩民的支持和信赖，吉林省福彩中心近期推出一系列大派奖活动，受到彩民朋友追捧。为了让开奖信息及时送达，给彩民朋友更多便利，吉林省福彩中心推出“吉林福彩”微信公众平台（微信号jlfcgw）。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	“吉林福彩”微信公众平台集实用性、服务性、趣味互动性于一身，第一时间为彩民送上福彩动态，包括：订制开奖信息、查找身边彩站、促销活动通告，中奖喜报、趣味互动游戏、虚拟投注、线上试玩等。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	在服务性方面，“吉林福彩”特别推出“兑奖指南、投注指南、选号工具”等功能，方便新彩民了解彩票基本知识，为老彩民提供更多购彩便利。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	此微信公众号上线后，吉林福彩各项派奖资讯，将第一时间在“吉林福彩”微信公众平台推出，无论是开奖信息还是大奖喜报，您都可以更加便捷地获取。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	您可以拿出手机，打开微信，找到“扫一扫”功能，扫描旁边的二维码，关注“吉林福彩”微信公众平台（微信号jlfcgw），开启您的全新玩彩之旅。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	<strong>福利彩票“快3”游戏玩法介绍</strong>\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	“快3”游戏是一种快速开奖的电脑型福利彩票，集中了目前彩市畅销快速开奖游戏的优点，返奖高、选号少、开奖快、固定奖、乐趣多，自上市销售以来即受到广大彩民的喜爱。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	投注\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	“快3”是指以三个号码组合为一注进行单式投注，每个投注号码为1～6，共六个自然数中的任意一个，一组三个号码的组合称为一注。每注金额人民币2元。购买者可对其选定的投注号码进行多倍投注，投注倍数范围为2～99倍。单张彩票的投注金额最高不得超过20000元。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	购买者可在福彩机构设置的销售网点投注。投注号码经投注机打印出对奖凭证，交购买者保存，此对奖凭证即为“快3”彩票。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	“快3”根据号码组合共分为“和值”、“三同号”、“二同号”、“三不同号”、“二不同号”、“三连号通选”投注方式，具体规定如下：\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	（一）和值投注：是指对三个号码的和值进行投注，包括“和值4”至“和值17”投注。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	（二）三同号投注：是指对三个相同的号码进行投注，具体分为：\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	1.&nbsp;三同号通选：是指对所有相同的三个号码（111、222、……、666）进行投注；\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	2.&nbsp;三同号单选：是指从所有相同的三个号码（111、222、……、666）中任意选择一组号码进行投注。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	（三）二同号投注：是指对两个指定的相同号码进行投注，具体分为：\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	1.&nbsp;二同号复选：是指对三个号码中两个指定的相同号码和一个任意号码进行投注；\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	2.&nbsp;二同号单选：是指对三个号码中两个指定的相同号码和一个指定的不同号码进行投注。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	（四）三不同号投注：是指对三个各不相同的号码进行投注。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	（五）二不同号投注：是指对3个号码中2个指定的不同号码和1个任意号码进行投注。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	（六）三连号通选投注：是指对所有3个相连的号码（仅限：123、234、345、456）进行投注。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	购买者可选择机选号码投注、自选号码投注。机选号码投注是指由投注机随机产生投注号码进行投注，自选号码投注是指将购买者选定的号码输入投注机进行投注。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	<strong>开奖</strong>\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	“快3”采用专用电子开奖设备开奖，每期随机生成三个号码，作为当期开奖号码，每个号码为1～6，共六个自然数中的任意一个。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	每期开奖后，吉林福彩机构将开奖号码、当期销售总额、中奖金额等信息，通过新闻媒体向社会公布，并将开奖结果通知销售网点。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	<strong>玩法特点</strong>\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	玩法新颖 趣味多娱乐性强“快3”游戏投注是指以3个号码组合方式为1注彩票进行的投注，每个投注号码为1～6，6个自然数中的任意1个。“快3”游戏改变了以往数字排列型或组合型的游戏方式，开奖号为3个不排序号码。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	返奖比例高 中奖好容易按照规则，“快3”游戏返奖率59%，是吉林省电脑福利彩票各游戏中最高的一种。返奖率的提高，就是奖金在总体销售额中所占比例增加，而奖金是用来回报彩民朋友的。\n</p>\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#F9F9F9;text-indent:2em;\">\n	2元也可以“包号”“快3”游戏最令人期待的，是“2元可以包号”。无论和值、单选、复选还是通选，每种单注投注金额都是人民币2元。\n</p>'),
(127, 2, 1, 1504597556, '三位得主各用奇招中福彩大奖 却有一个共同点', '<div class=\"top_links\" style=\"color:#666666;font-family:\'Microsoft Yahei\';background:#F7A3A3;\">\n	摘要：福彩3D游戏，被誉为“蓝色的小精灵”，它以独特的魅力，赢得了诸多彩友的青睐。也许这段时间群英会频频为临沂彩友送来了大礼，可爱的小精灵坐不住了，也为彩友们送来了惊喜\n</div>\n<div class=\"content\" style=\"margin:35px 8px;font-size:14px;color:#666666;font-family:\'Microsoft Yahei\';background-color:#FFFFFF;\">\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;福彩3D游戏，被誉为“蓝色的小精灵”，它以独特的魅力，赢得了诸多彩友的青睐。也许这段时间群英会频频为临沂彩友送来了大礼，可爱的小精灵坐不住了，也为彩友们送来了惊喜。\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;7月10日，3D游戏爆发出惊人能量，沂南彩友赵先生（化姓）于37132115福彩站倍投号码“380”一举拿下2016185期奖金107466元；\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;8月2日，兰山彩友田先生（化姓）采用单选位选的方式于37130302、37130290、37130206和37130270四个福彩站收获了奖金46800元；\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;8月5日，河东区彩友李先生（化姓）于37131225福彩站倍投“634”组三和组六喜得奖金36390元。近日，他们纷纷来到市中心兑奖处领取了奖金。\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;兑奖时，我们发现三位中奖彩友都有一个共同的特点：喜欢倍投。在三位中奖彩友中，“彩龄”最少的也有四五年了，他们都很喜欢3D游戏。即使在不同的地方，他们也会利用空闲的时间查看号码走势图，只要瞅准号码，投注起来毫不犹豫。在选号方面，赵先生坦言“和值”很重要；田先生和李先生则侧重于自身的感觉。其实，不管是运用什么方式，能从投注中收获快乐，享受到其中的乐趣就是最大的收获。\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;赵先生说，他每次投注前都会仔细研究一番，有时候定好的号码到了投注站后，还是会根据彩友们或者业主的建议作出相应的调整，群策群力才能收到更好的效果，擒得大奖的几率也会大大提高。\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;相对于赵先生的严格要求，田先生和李先生的选号方式就显得越发的感性。领奖时，他们说，选号其实蛮费脑筋的，有时候上了一天的班或忙了一天后，到投注站买几张彩票，多少有些调整心情的味道，看着哪个号不错就直接选哪个，要是拿不准的还会采取其他的投注方式，比如说位选、复式或组选，也能做到全面的“照顾”。\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;其实，说到底，不管投注福利彩票哪款游戏，选择哪种投注方式，最重要的是保持一个良好的心态，这样才能天天都有一份好心情，在奉献中体验快乐，在投注中享受过程，在过程中收获大奖，一举多得的事情，您说呢？\n	</p>\n</div>'),
(128, 2, 1, 1504597574, '投注好技巧 彩民时隔十天再擒福彩3D万元大奖', '<div class=\"top_links\" style=\"color:#666666;font-family:\'Microsoft Yahei\';background:#F7A3A3;\">\n	摘要：港城彩民路先生于8月1日领取3D万元大奖之后，仅隔十天再次在兑奖大厅出现，这次他以10倍投注“3-3-4”号码，又拿下3D第2016216期奖金10400元奖金。\n</div>\n<div class=\"content\" style=\"margin:35px 8px;font-size:14px;color:#666666;font-family:\'Microsoft Yahei\';background-color:#FFFFFF;\">\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;港城彩民路先生于8月1日领取3D万元大奖之后，仅隔十天再次在兑奖大厅出现，这次他以10倍投注“3-3-4”号码，又拿下3D第2016216期奖金10400元奖金。\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;彩民路先生是福建安溪人，来连工作已有多年。从上半年开始，他开始关注福彩3D，经常在站点研究中奖号码走势图，与站点老彩民聊天、取经。如今他买3D已有自己的一套规律，不能说是逢买必中，但已然从一个门外汉变成了一个行家里手，经常中奖。\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;路先生说，自从上次获得万元大奖之后，他对买3D更是信心十足。8月11日晚，路先生来到海州区青年路大苏果超市32070202福彩投注站，他延续上次的中奖经验，利用近期开奖走势图将他看好的三个数字“3”、“4”、“5”组合进行有规律地筛选、组合，最终确定为“3-3-4”、“4-3-3”、“5-5-4”、“4-5-5”，并且每个投注10倍。其中“3-3-4”是第2016216期开奖号码。\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;兑奖后的路先生还开起玩笑说，“我相信，过几天我们还会再见面的。”说完，兑奖大厅回荡起爽朗的笑声。陆先生表示接下来还会深入研究双色球，希望自己能够中得大奖，奉献自己的一份爱心。\n	</p>\n</div>');
INSERT INTO `blast_content` (`id`, `nodeId`, `enable`, `addTime`, `title`, `content`) VALUES
(129, 2, 1, 1504597592, '沭阳老彩民灵感浮现 喜中福彩3D大奖四万多元', '<div class=\"top_links\" style=\"color:#666666;font-family:\'Microsoft Yahei\';background:#F7A3A3;\">\n	&nbsp;摘要：2016年8月10日，福彩3D第2016216期开出中奖号码334，沭阳县福彩32135337站点一彩民中得40注直选，奖金共计41600元。\n</div>\n<div class=\"content\" style=\"margin:35px 8px;font-size:14px;color:#666666;font-family:\'Microsoft Yahei\';background-color:#FFFFFF;\">\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;2016年8月10日，福彩3D第2016216期开出中奖号码334，沭阳县福彩32135337站点一彩民中得40注直选，奖金共计41600元。\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;据了解，中得此奖的彩民是该站点的老彩民，她是浙江的一位女老板，因生意关系来沭阳。她本人在老家的时候就喜欢玩彩票，来沭阳后因其店离32135337站点相距不远，便没事的时候就到站点坐坐，看看走势图，分析号码变化，和其他彩友相互讨论一下。\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;8月10日，她像往常一样来到站点后，在看完走势图后，觉得今天组选三开出的机率非常大，尤其看好数字345，她便花200元买了“554”“455”“545”“334”几组号码，结果，她幸运地中了40注334，收获了41600元。\n	</p>\n</div>'),
(130, 2, 1, 1504597609, '不打无准备之仗 美女复式选号收获福彩3D大奖', '<div class=\"top_links\" style=\"color:#666666;font-family:\'Microsoft Yahei\';background:#F7A3A3;\">\n	摘要：8月15日2时许，天气异常闷热，人们纷纷躲进空调房，体会着 “我的生命是空调给的”个中滋味。这时，两位时尚、貌美的女子轻轻地推开门，走进了东台市福彩32090934站点。炎热酷暑，烈日当头，这让站主诸葛大为感动，又陡生一丝怜香惜玉之情\n</div>\n<div class=\"content\" style=\"margin:35px 8px;font-size:14px;color:#666666;font-family:\'Microsoft Yahei\';background-color:#FFFFFF;\">\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;8月15日2时许，天气异常闷热，人们纷纷躲进空调房，体会着 “我的生命是空调给的”个中滋味。这时，两位时尚、貌美的女子轻轻地推开门，走进了东台市福彩32090934站点。炎热酷暑，烈日当头，这让站主诸葛大为感动，又陡生一丝怜香惜玉之情。 &nbsp;\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;两位妙龄女郎卸掉防晒的全套装备，从香包里掏出3D走势图，发现精心研究的心仪组合号码事隔两天仍然没有开出，顿感绝佳的战机就在眼前，机不可失时不再来，当即让诸葛照打原先的组合号，同时将投注方式做了微调，改组六复式投注为单选全复式投注。这时的诸葛额头和手心已经溢出了汗水。这组号码，她们已经玩了两天了，投入不少，颗粒无收，况且又过了两天，很难说这组号码不打入冷宫。但美女坚持，怎能说三道四，怠慢含糊？！诸葛调整了一下情绪，认认真真地按单选全复式模式，敲打着0245678这几个枯燥无味的数字，按美女的要求一共打出20多张，总计146倍。此时的美女视乎若无其事，诸葛确感到压力千钧，他在心里默默祈祷：“天灵灵，地灵灵，保佑两位美女如愿以偿……”。 &nbsp; 当晚，福彩3D开奖的号码为808，美女的号码一网打尽，获奖金15万多元。诸葛第一时间用手机把喜讯告诉了两位美女，美女小周在手机里淡淡地笑了笑，“碰巧了，那就麻烦你帮我们把将领回来呗。”\n	</p>\n	<p style=\"font-size:12px !important;color:#333333 !important;\">\n		&nbsp; &nbsp; &nbsp; &nbsp;诸葛介绍，两位美女是最近才来到他这个站点的。可以肯定地说，她们不是新手，玩彩十分老道，且出手不凡。她们尤为喜欢3D，且爱做计划，不打无准备之仗，不人云亦云，很有主见，看准的，不放弃，不抛弃。认定的，坚持，再坚持。两位美女天生羞涩，不喜欢在人多的情况下露面，总是在人少或者没人的情况下一展身手。诸葛坦言，有美女来本店玩彩真好，美女玩彩本身就是一道亮丽的风景。\n	</p>\n</div>');
